// import React, {Component} from 'react';
import axios from 'axios';
function FetchOpenWeather(props) {
    axios.get('http://openweathermap.org/data/2.5/weather?q=%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0&appid=b6907d289e10d714a6e88b30761fae22')
      .then(response => {
        console.log(response.data.main)
      })
}

export default FetchOpenWeather;
